// src/pages/TimelinePage.js

import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import '../style.css'; // Ensure styles are applied to this page

function TimelinePage() {
  return (
    <div>
      <Header />

      {/* Timeline Section */}
      <section className="timeline-section">
        <h1>50 Years of NSBE</h1>
        <div id="timeline-container">
          {/* This is where dynamic content can be added later */}
          <p>Explore the journey and achievements of the National Society of Black Engineers over the past 50 years.</p>
          {/* You could add more details or events as needed */}
        </div>
      </section>

      <Footer />
    </div>
  );
}

export default TimelinePage;
